    this.dialog = dialog;
    this.dataService = dataService;
    this.name = "";
    this.Job = "";
    this.Manufacturer = "";
    this.Aircraft = "";
    this.i = 0;
    this.isButtonVis = true;
    this.isButtonVi = false;
    this.isButtonVisible = true;
    this.visible = false;
    this.isVisible = false;
    this.isVis = false;
    this.data = [];
    this.Variableopen = false;
    this.variables = [{
      objectName: {
        label: 'Object Name',
        model: '',
        placeholder: '',
        disabled: true
      },
      drawingNumber: {
        label: 'Drawing Number',
        model: '',
        placeholder: '',
        disabled: true
      },
      direction: {
        label: 'Manufacturer',
        model: '',
        disabled: true
      },
      dataType: {
        label: 'Aircraft Name',
        model: '',
        placeholder: '',
        disabled: true
      },
      size: {
        label: 'Size',
        model: '',
        placeholder: '',
        disabled: true
      }
    }];
    this.projectFields = [{
      username: {
        label: 'Username',
        model: '',
        placeholder: '',
        disabled: false
      },
      Job: {
        label: 'Job #',
        model: '',
        placeholder: '',
        disabled: false
      },
      Manufacturer: {
        label: 'Manufacturer',
        model: '',
        placeholder: '',
        disabled: false
      },
      Aircraft: {
        label: 'Aircraft Name',
        model: '',
        placeholder: '',
        disabled: false
      }
    }];
    this.boardFields = [];
    // the board we're working with.
    this.board = this.dataService.data.boards[this.dataService.data.current_board];
    this.shouldRun = true;
    this.isSidenavOpened = false;
  }
  saveData() {
    if (this.projectFields.length > 0) {
      const username = this.projectFields[0].username.model;
      const jsonData = JSON.stringify({
        username
      });
      localStorage.setItem('data', jsonData);
      console.log('Saved username:', username);
    }
  }
  toggleSidenav() {
    this.isSidenavOpened = !this.isSidenavOpened;
  }
  openDialog() {
    const dialogRef = this.dialog.open(SearchDialogComponent, {
      width: '900px'
    });
    dialogRef.afterClosed().subscribe(result => {});
  }
  openAddNewBoard() {
    const dialogRef = this.dialog.open(NewBoardComponent, {
      width: '900px'
    });
    dialogRef.afterClosed().subscribe(result => {});
  }
  updateProject() {
